def a(e, r):
    # 从字符串e的索引r开始，取出两个字符，并转换为16进制整数
    t = int(e[r:r + 2], 16)

    # 根据最高位判断编码长度，并计算完整的Unicode字符
    if t >> 7 == 0:
        return [1, t]
    elif t >> 6 == 2:
        # 取出接下来的两个字符，并与当前字符拼接
        t = (63 & t) << 8
        next_two_chars = int(e[r + 2:r + 4], 16)
        t += next_two_chars
        return [2, t]
    else:
        # 取出接下来的三个字符，并与当前字符拼接
        t = (63 & t) << 16
        next_three_chars = int(e[r + 2:r + 6], 16)
        t += next_three_chars
        return [3, t]
    
